public class Main11 {
    public static void main(String[] args) {
        findTheDifference("", "");
    }
    public static char findTheDifference(String s, String t) {
        char ts = '0';
        char[] char_s = s.toCharArray();
        char[] char_t = t.toCharArray();
        Map<Character, Integer> map1 = new HashMap<>();
        Map<Character, Integer> map2 = new HashMap<>();
        for (int i = 0; i < char_s.length; i++) {
            if (!map1.containsKey(char_s[i])) {
                map1.put(char_s[i], 1);
            } else {
                int count = map1.get(char_s[i]) + 1;
                map1.put(char_s[i], count);
            }
        }
        for (int j = 0; j < char_t.length; j++) {
            if (!map2.containsKey(char_t[j])) {
                map2.put(char_t[j], 1);
            } else {
                int count = map2.get(char_t[j]);
                map2.put(char_t[j], ++count);
            }
        }
        Set<Character> characters2 = map2.keySet();
        for (Character character : characters2) {
            if(!map1.containsKey(character)){
                ts = character;
            }
            if(map1.containsKey(character) && !map1.get(character).equals(map2.get(character))){
                ts = character;
            }
        }
        System.out.println(ts);
        return ts;
    }
}

